import React, {Component} from 'react';
class Menubar extends Component{
    render(){
      return(
        
        <nav class="nav nav-pills flex-column flex-sm-row" className="navbar">
        <a class="flex-sm-fill text-sm-center nav-link active text-black" href="#">메뉴</a>
        <a class="flex-sm-fill text-sm-center nav-link text-black" href="#">동아리 보기</a>
        <a class="flex-sm-fill text-sm-center nav-link text-black" href="#">가입 신청</a>
        <a class="flex-sm-fill text-sm-center nav-link text-black" href="#">마이페이지</a>
        
      </nav>
      );
    }
  }
export default Menubar;
